document.body.style.backgroundImage = 'url("http://img.geocaching.com/cache/07a55a5c-f99a-453e-820e-e4912a5742ac.jpg?rnd=0.988561")';

var newCoords;
var oldCoords = document.getElementById('uxLatLon');
if (oldCoords) {
    newCoords = document.createElement("span");
    newCoords.innerHTML = '<span style="font-weight: bold;" id="uxLatLon">N 48&#176; 59.290 E 008&#176; 25.064</span>';
    oldCoords.parentNode.replaceChild(newCoords, oldCoords);
}

var newUTMCoords;
var oldUTMCoords = document.getElementById('ctl00_ContentBody_LocationSubPanel');
if (oldUTMCoords) {
    newUTMCoords = document.createElement("span");
    newUTMCoords.innerHTML = '<span style="display: inline;" id="ctl00_ContentBody_LocationSubPanel"><small>UTM: 32U E 457402 N 5426304</small><br/></span>';
    oldUTMCoords.parentNode.replaceChild(newUTMCoords, oldUTMCoords);
}

var arrayHyperlink = document.getElementsByTagName("a");
var intHyperlinkCounter=0;
var imgSpoiler;
while(intHyperlinkCounter<arrayHyperlink.length)
{
if(arrayHyperlink[intHyperlinkCounter].href == "http://img.geocaching.com/cache/large/612471f1-dfd8-445c-b6e0-3777abeeb686.jpg")
{
    imgSpoiler = document.createElement('a');
    imgSpoiler.innerHTML = '<br /><a href="http://img.geocaching.com/cache/large/c6bd51c9-b767-487f-b860-a023177d4860.jpg" rel="lightbox" class="lnk"><img class="StatusIcon" src="/images/stockholm/16x16/images.gif" alt="Photos" title="Photos" /><span>Spoiler</span></a><br />';
    arrayHyperlink[intHyperlinkCounter].parentNode.insertBefore(imgSpoiler, arrayHyperlink[intHyperlinkCounter].nextSibling);
}
intHyperlinkCounter=intHyperlinkCounter+1;
}

var arrayImages = document.getElementsByTagName("img");
var intImageCounter=0;
while(intImageCounter<arrayImages.length)
{
if(arrayImages[intImageCounter].src == "http://img.geocaching.com/cache/large/612471f1-dfd8-445c-b6e0-3777abeeb686.jpg?rnd=0.7237142")
{
arrayImages[intImageCounter].src = "data:image/jpg;base64,";
}
intImageCounter=intImageCounter+1;
}


